        """
        :type nums: List[int]
        :type k: int
        :rtype: int
        """

        nums.sort()
        l, r = 0, nums[-1] - nums[0]
        while l < r:
            mid = (l + r) // 2
            cnt = 0
            j = 0
            for i in range(len(nums)):
                while nums[i] - nums[j] > mid:
                    j += 1
                cnt += i - j
