class Solution(object):
    def removeInvalidParentheses(self, s):
        """
        :type s: str
        :rtype: List[str]
        """

        def isValid(s):
            count = 0
            for c in s:
                if c == '(':
                    count += 1
                elif c == ')':
                    if count > 0:
                        count -= 1
                    else:
                        return False
            return count == 0

        queue = collections.deque([s])
        seen = set([s])
        while queue:
            s = queue.popleft()
            if isValid(s):
                return [s]
            for i in range(len(s)):
                if s[i] not in '()':
                    continue
